import { Component, ViewChild, ElementRef } from '@angular/core';
//import * as jsPDF from 'jspdf';

declare var jsPDF: any; // Important

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})


export class AppComponent {

  public downloadPDF() {
    // Utilize esse site para converter uma imagem em base64 http://dataurl.net/#dataurlmaker
    // let base64Img = 'data:image/jpeg;base64,data:image/png;base64, colaraqui'
    //npm install jspdf-autotable --save

    // DADOS DO RELATÓRIO

    //logotipo
    let base64Img = 'data:image/png;base64,'
    let columns = ["ID", "Name", "Country"];
    let rows = [
        [1, "Shaw", "Tanzania"],
        [2, "Nelson", "Kazakhstan"],
        [3, "Garcia", "Madagascar"]
    ];
    // DADOS DO RELATÓRIO

    let doc = new jsPDF();
    let customizacaoPagina = function (data) {
        // HEADER
        doc.setFontSize(16);
        doc.setTextColor(40);
        doc.setFontStyle('normal');
        doc.addImage(base64Img, 'JPEG', data.settings.margin.left, 15, 20, 0); // definindo logotipo (imagem)
        doc.text("Demanda - Report Mensal", data.settings.margin.left + 25, 20.5); // titulo

        // FOOTER
        let str = "Raizen Setembro/2018";
        doc.setFontSize(10);
        let pageHeight = doc.internal.pageSize.height || doc.internal.pageSize.getHeight();
        doc.text(str, data.settings.margin.left, pageHeight  - 10);
    };
    
    doc.autoTable(columns, rows, {
        addPageContent: customizacaoPagina,
        margin: {top: 30},
        tableLineColor: [242, 242, 242],
        tableLineWidth: 0.25,
        styles: {
            font: 'Helvetica',
            lineColor: [255, 255, 255],
            lineWidth: 0.25
        },
        headerStyles: {
            fillColor: [135, 33, 117],
            fontSize: 12
        },
        bodyStyles: {
            fillColor: [255, 255, 255],
            textColor: 79
        },
        alternateRowStyles: {
            fillColor: [247, 247, 247]
        },
    });

    doc.save('ReportRaizen_HF.pdf');
  }
}